import React from "react";
import Container from "react-bootstrap/Container";
import "../Navgation/nav.css"

const Navgation = () => {
  return (
    <nav>
      <Container>
        <div className="row">
            .col
        </div>
      </Container>
    </nav>
  );
};
export default Navgation;
